import Link from "next/link";
import { Navbar, Row, Col } from "react-bootstrap";
import styles from "./AppNavBar.module.css";

const AppNavbar = () => {
  return (
    <Navbar bg="transparent" variant="dark" className={styles.header}>
      <Row className="w-100">
        <Col sm={4}></Col>
        <Col sm={4}>
          <Navbar.Brand href="/">
            <img
              alt=""
              src="/logo.png"
              width="250"
              height="150"
              className="d-inline-block align-top"
            />
          </Navbar.Brand>
        </Col>
        <Col sm={4}></Col>
      </Row>
    </Navbar>
  );
};

export default AppNavbar;
